// Home.jsx
import React, { useEffect } from 'react';
import './Home.css';
import { useTypewriter, Cursor } from 'react-simple-typewriter';

export const Home = () => {
  const [text] = useTypewriter({
    words: ['Front-end Developer', 'UI/UX Designer', 'Web Developer'],
    loop: {},
    typeSpeed: 100,
    deleteSpeed: 70,
  });

  // Subtle parallax effect
  useEffect(() => {
    const handleScroll = () => {
      const scrollPosition = window.scrollY;
      if (document.querySelector('.profile-image')) {
        document.querySelector('.profile-image').style.transform = 
          `translateY(${scrollPosition * 0.15}px)`;
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <div className="home-container">
      <div className="elegant-backdrop">
        <div className="backdrop-circle circle-1"></div>
        <div className="backdrop-circle circle-2"></div>
      </div>
      
      <div className="content-section">
        <div className="text-section">
          <h2 className="subtitle">Welcome to my portfolio</h2>
          <h1 className="name">Yaman Ajlouni</h1>
          
          <div className="profession">
            <span className="profession-text">{text}</span>
            <Cursor cursorStyle="|" />
          </div>
          
          <div className="separator"></div>
          
          <p className="introduction">
            Creating elegant digital experiences with a focus on aesthetics and functionality.
          </p>
          
          <div className="cta-container">
            <button className="cta-button primary">View Portfolio</button>
            <button className="cta-button secondary">Contact Me</button>
          </div>
        </div>
        
        <div className="image-section">
          <div className="image-container">
            <div className="image-frame">
              <img 
                className="profile-image" 
                src={require('../../assets/YamanHD.png')} 
                alt="Yaman Ajlouni" 
              />
            </div>
          </div>
        </div>
      </div>
      
      <div className="social-bar">
        <a href="#" className="social-link">LinkedIn</a>
        <span className="social-divider">•</span>
        <a href="#" className="social-link">GitHub</a>
        <span className="social-divider">•</span>
        <a href="#" className="social-link">Dribbble</a>
      </div>
    </div>
  );
};
